export const getEvents = (categorie) => fetch("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2?q="+ categorie, {
    method: "GET",
    mode: "no-cors"
}).then((res) => {
    return res.text();
});
